import React from "react";

const Pos = () => {
  return (
    <div style={{ width: "100%", paddingTop: "40px", paddingBottom: "40px",display:"flex" }}>
      <div style={{ width: "50%", display: "flex" }}>
        <img style={{ width: "100%" }} src="./img/p.png" alt="" />
      </div>
      <div>
                <div>Still have questions?</div>
                <div>Get answers from an experienced Superhost near you.</div>
                <div> <button>Match With a Superhost</button></div>
            </div>
    </div>
  );
};

export default Pos;
